  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This database consists of those national
  and international standards recognized by FDA which manufacturers can declare conformity
  to and is part of the information the Center can use to make an appropriate decision
  regarding the clearance or approval of a submission. Information submitted on conformance
  with such standards will have a direct bearing on safety and effectiveness determinations
  made during the review of IDEs, HDEs, PMAs, and PDPs. Conformance with recognized
  consensus standards in and of itself, however, may not always be a sufficient basis
  for regulatory decisions.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
